import React,{useState} from "react";

const Counter = () => {

    const [count, setCount] = useState(0);

    const onIncrease = () => {
        setCount(count+1);
    }

    const onDecrease = () => {
        setCount(count-1);
    }

    return (
        <div>
            <h2>{count}</h2>
            <button OM>onIncrease</button>
            <button>onDecrease</button>
        </div>
    )
}

export default Counter;
